const keywordMap = {};

for (const item of $input.all()) {
  const keyword = item.json.Keyword;
  const site = item.json.Site;

  if (!keywordMap[keyword]) {
    keywordMap[keyword] = {
      sites: [],
      urls: []
    };
  }

  // Evita duplicatas de sites
  if (!keywordMap[keyword].sites.includes(site)) {
    keywordMap[keyword].sites.push(site);
  }

  // Adiciona todas as URLs (mesmo que do mesmo site)
  keywordMap[keyword].urls.push(item.json.URL);
}

// Convert to array format that n8n expects
const result = Object.entries(keywordMap).map(([keyword, data]) => ({
  json: {
    keyword,
    sites: data.sites,
    urls: data.urls,
    count: data.sites.length,
    // Número de sites distintos
  }
}));
return result;

