const axios = require('axios');

// Configuração dos dados para a API
const post_array = [{
  "targets": $input.first().json.Site
}];

// Configurações da requisição
const config = {
  method: 'post',
  url: 'https://api.dataforseo.com/v3/backlinks/bulk_backlinks/live',
  auth: {
    username: '',  
    password: "" // Substitua por suas credenciais
  },
  data: post_array,
  headers: {
    'content-type': 'application/json'
  }
};

try {
  // Faz a requisição usando Axios
  const response = await axios(config);

  // Processa a resposta para o formato do n8n
  const result = response.data.tasks;

  // Formata os itens de saída
  const items = result.map(task => {
    return {
      json: {
        ...task // Inclui todas as propriedades da task
      }
    };
  });

  // Retorna os itens para os próximos nós
  return items;

} catch (error) {
  // Tratamento de erros
  let errorMessage = error.message;

  // Se a resposta de erro contiver dados, adiciona ao message
  if (error.response && error.response.data) {
    errorMessage += ` | ${JSON.stringify(error.response.data)}`;
  }

  return [{
    json: {
      error: errorMessage
    }
  }];
}

